import {makeStyles} from '@material-ui/core/styles';

const useStyles = makeStyles(
  (theme) => ({
    root: {
      
    },
    testHeading: {
      fontWeight: '1000',
      fontSize: '36px'
    },
    imgContainer: {
      height: 'auto'
    },
    loungeImg: {
      margin: 'auto 0',
      width: '100%'
    }
  }),
  {index: 1},
);

export default useStyles;
